import ExpenseItem from "./ExpenseItem";
import "./DisplayExpenses.css";

function DisplayExpenses(props) {

  return (
    <div>
  <ExpenseItem className="expenses" title={props[0].title} amount={props[0].amount} date={props[0].date} />
  <ExpenseItem className="expenses" title={props[1].title} amount={props[1].amount} date={props[1].date} />
  <ExpenseItem className="expenses" title={props[2].title} amount={props[2].amount} date={props[2].date} />
  <ExpenseItem className="expenses" title={props[3].title} amount={props[3].amount} date={props[3].date} />
  </div>
  );
}

export default DisplayExpenses;
